import './aboutProject.scss'
function AboutProject (){
    return (
        <section className="aboutProject">
            <h1 className='aboutProject__title'>Технологии</h1>
            <div className='aboutProject__info'>
                <div className='aboutProject_texts'>
                  <h1 className='aboutProject__header'>7 технологий</h1>
                  <h2 className='aboutProject__about'>На курсе веб-разработки мы освоили технологии, которые применили в дипломном проекте.</h2>
                <div className='aboutProject__timeline'>

                </div>
                </div>

            </div>

        </section>
    );
}

export default AboutProject;
